{
  "ubx_message": {
    "name": "UBX-MON-IO",
    "class_id": "0x0a",
    "message_id": "0x02",
    "message_type": "periodic_polled",
    "comment": "This message is deprecated in this protocol version. Use UBX-MON-COMMS instead. The size of the message is determined by the number of ports 'N' the receiver supports, i.e. on u-blox 5 the number of ports is 6.",
    "payload_length": {
      "variable": {
        "formula": "N * 20"
      }
    },
    "payload": [
      {
        "repeated_group": {
          "name": "ports",
          "count": "N",
          "elements": [
            {
              "byte_offset": 0,
              "data_type": "U4",
              "name": "rxBytes",
              "description": "Number of bytes ever received",
              "unit": "bytes"
            },
            {
              "byte_offset": 4,
              "data_type": "U4",
              "name": "txBytes",
              "description": "Number of bytes ever sent",
              "unit": "bytes"
            },
            {
              "byte_offset": 8,
              "data_type": "U2",
              "name": "parityErrs",
              "description": "Number of 100 ms timeslots with parity errors"
            },
            {
              "byte_offset": 10,
              "data_type": "U2",
              "name": "framingErrs",
              "description": "Number of 100 ms timeslots with framing errors"
            },
            {
              "byte_offset": 12,
              "data_type": "U2",
              "name": "overrunErrs",
              "description": "Number of 100 ms timeslots with overrun errors"
            },
            {
              "byte_offset": 14,
              "data_type": "U2",
              "name": "breakCond",
              "description": "Number of 100 ms timeslots with break conditions"
            },
            {
              "byte_offset": 16,
              "data_type": {
                "array_of": "U1",
                "count": 4
              },
              "name": "reserved0",
              "reserved": true,
              "description": "Reserved"
            }
          ]
        }
      }
    ]
  }
}
